import React from "react";
import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <ul>
      <li>
        <NavLink
          to="/src/components/CutData.js"
        >
          1
        </NavLink>
      </li>
      <li>
        <NavLink
          to="/src/components/Data.js"
        >
          2
        </NavLink>
      </li>
    </ul>
  );
};

export default Nav;
